package com.sai;

public class WhileAndDoWhileExample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i = 11;int j =11;
		while(i <= 10) {
				System.out.println("number from while "+i);
		i ++;	//i = i+1;
		}
		
		do {
			System.out.println("number from do-while "+j);
			j++;//12
		} while (j <= 10) ;

	}

}
